import React, { useEffect } from 'react';

export const Tile = ({tile}) => {

  useEffect(() => {
    console.log(tile);
    console.log(Object.keys(tile));
    console.log(tile[Object.keys(tile)[3]]);
  });

  return (
    <div className="tile-container">
      {
        Object.keys(tile).map((property, index) => {
          if (index == 0) {
            return <p className="tile-title">{tile[property]}</p>
          } else {
            return <p className="tile">{tile[property]}</p>;
          }
        })
      }
    </div>
  );
};
